import React from "react";

const Card = ({ data }) => {
  return (
    <div className="card-wrapper">
      <div className="my-card">
        <div className="header">
          <p className="title">{data.title}</p>
        </div>
        <div className="content"></div>
        <div className="footer"></div>
      </div>
    </div>
  );
};

export default Card;
